import React from 'react';
import ReactDOM from 'react-dom/client';
import './styles/App.css';  // Ensure App.css is loaded from the styles folder
import './styles/Login.css'; // Include additional CSS files if needed
import './styles/TopicList.css'; // Include additional CSS files if needed
import App from './App'; // Import the main App component

// Create a root element and render the app
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
